				ret +=  library.tool.text.edit( elementId, elem, obj, editlabel, editid + '_alt', editclass, editvalue );
				
				editlabel = library.tool.image.language.title[lang];
				editvalue = obj.attr('title') ? obj.attr('title') : "";
				editclass = elem.name + 'title';
				ret +=  library.tool.text.edit( elementId, elem, obj, editlabel, editid + '_title', editclass, editvalue );
				
